export const toc = [{
  value: 'Our Pledge',
  id: 'our-pledge',
  children: []
}, {
  value: 'Our Standards',
  id: 'our-standards',
  children: []
}, {
  value: 'Our Responsibilities',
  id: 'our-responsibilities',
  children: []
}, {
  value: 'Scope',
  id: 'scope',
  children: []
}, {
  value: 'Enforcement',
